import { useEffect, useState } from "react";
import useListRepositoriesData from "./hooks/useListRepositories";

function App() {
  const { response } = useListRepositoriesData();
  const [repositories, setRepositories] = useState([]);

  useEffect(() => {
    response().then((data) => {
      setRepositories(data);
    });
  }, []);

  return (
    <div className='App'>
      <header className='App-header'>
        <p>
          Edit <code>src/App.tsx</code> and save to reload.
        </p>
        <a
          className='App-link'
          href='https://reactjs.org'
          target='_blank'
          rel='noopener noreferrer'
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
